import React from 'react';

const ResultList = (props) => {
    console.log("ResultList", props)
    const results = props.result.map((video, index) =>
        ` <div class="ui card">
            <div class="image">
            <img src=${video.snippet.thumbnails.default} ></img>
            </div>
        </div>    `

    )
    return <p>Return</p>
}

export default ResultList;
